using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace TransITGeometryTransferRevit
{
    class TemplateFamiliesBase64
    {
        public const string profileFamilyTemplateBase64 = "";

        public static string GetBase64FamilyPath(string base64string)
        {
            string fileName = System.IO.Path.GetTempPath() + Guid.NewGuid().ToString() + ".rfa";
            var logoInBytes = Convert.FromBase64String(base64string);
            System.IO.File.WriteAllBytes(fileName, logoInBytes);

            return fileName;
        }

    }
}
